import React from "react";
import { Image } from "semantic-ui-react";
import * as avatars from "../../../avatar/";

const MEMBERS = [
  {
    avatar: avatars.dad,
    name: "Lucas Sett",
  },
  {
    avatar: dad,
    name: "Lucas Sett",
  },
  {
    avatar: dad,
    name: "Lucas Sett",
  },
  {
    avatar: dad,
    name: "Lucas Sett",
  },
  {
    avatar: dad,
    name: "Lucas Sett",
  },
];
const Member = () => {
  return (
    <div className="chat-container member border">
      <div className="member-header">
        <h4>{MEMBERS.length} Member(s)</h4>
      </div>
      <div className="member-list">
        {MEMBERS.map(({ avatar, name }, id) => {
          return (
            <div className="member-item" key={name + id}>
              <Image src={avatar} size="mini" circular className="center" />
              <div>{name}</div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Member;
